        public void GenerateTrainingData()
        {
            int workerCount = Convert.ToInt32(WorkerCount.Text.ToString());
            int maleCount = Convert.ToInt32(MaleCount.Text.ToString());
            int femaleCount = Convert.ToInt32(FemaleCount.Text.ToString());
            int empCount = Convert.ToInt32(EmpCount.Text.ToString());
            int contWorkerCount = Convert.ToInt32(ContWorkerCount.Text.ToString());

            int tempEmpCount = (empCount / 2);
            //Male Employees
            for(int count=0;count< maleCount; count++)
            {
                String workerFirstName = GetFirstMaleName();
                String workerLastName = GetLastName();
                String workerGender = "MALE";
                String workerType = null;
                String workerApplicantID = "TRAIN0"+ (count+1);
                String workerEmailID = workerFirstName[1] + workerLastName + "@DummyOrg.com";
                if((count+1) <= tempEmpCount)
                {
                    workerType = "Employee";
                }
                else
                {
                    workerType = "Contingent";
                }
                tempTuple = new Tuple<int, string, string, string, string, string, string>(count+1, workerFirstName, workerLastName, workerGender, workerType, workerApplicantID, workerEmailID);
                dummyWorkerDetails.Add(tempTuple);
            }
            //Female Employees
            for (int count = 0; count < femaleCount; count++)
            {
                String workerFirstName = GetFirstFemaleName();
                String workerLastName = GetLastName();
                String workerGender = "FEMALE";
                String workerType = null;
                String workerApplicantID = "TRAIN0" + (maleCount+ count + 1); ;
                String workerEmailID = workerFirstName[1] + workerLastName + "@DummyOrg.com";
                if (count < tempEmpCount)
                {
                    workerType = "Employee";
                }
                else
                {
                    workerType = "Contingent";
                }
                tempTuple = new Tuple<int, string, string, string, string, string, string>(count + 1, workerFirstName, workerLastName, workerGender, workerType, workerApplicantID, workerEmailID);
                dummyWorkerDetails.Add(tempTuple);
            }
        }
